(3466, '', 'Santafe Steak', '02-613-1277', 1, NULL, NULL, NULL),
(3467, 'The Grand Palace and Wat Prakaew command respect from all who have walked in their sacred grounds. Built in 1782, and for 150 years the home of Thai Kings and the Royal court, the Grand Palace continues to have visitors in awe with its beautiful architecture and intricate detail. Wat Pra Kaew enshrines Phra Kaew Morakot (the Emerald Buddha), the sacred Buddha image meticulously carved from a single block of emerald. ', 'The Grand Palace', '', 1, NULL, NULL, '/grand-palace.jpg'),
(3468, 'The impressive silhouette of Wat Arun’s towering spires is one of the most recognised in Southeast Asia. Constructed during the first half of the 19th century in the ancient Khmer style, the stupa showcasing ornate floral pattern decked out in glazed porcelain is stunning up close. Apart from its beauty, Wat Arun symbolises the birth of the Rattanakosin Period and the founding of the new capital after Ayutthaya fell.', 'Wat Arun', '', 1, NULL, NULL, '/bangkok-riverside.jpg'),
(3469, 'The pioneer of all floating markets, Damnoen Saduak continues to offer an authentic experience despite its increasingly touristy atmosphere. Imagine dozens of wooden row boats floating by, each laden to the brim with farm-fresh fruits, vegetables or flowers. Food vendors fill their vessels with cauldrons and charcoal grills, ready to whip up a bowl of ‘boat noodle’ or seafood skewers upon request.', 'Khlong Lat Mayom Floating Market', '', 1, NULL, NULL, '/Bangkok Floating Markets.jpg'),
(3470, 'Located at the end of Chinatown''s Yaowarat Road, near Hualampong Railway Station, Wat Traimit houses the world''s largest massive gold seated Buddha measuring nearly five metres in height and weighing five and a half tons. In the past, artisans crafted the Buddhas in gold and disguised them from invading armies by a covering of stucco and plaster.', 'Wat Traimit', '', 1, NULL, NULL, '/wat-traimit-2.jpg'),
(3471, 'Sampeng Lane Market pretty much sums up the whole shopping experience of Chinatown – and, to some extent, the surrounding Old City area; it’s hot, busy, and the narrow lanes often become overly congested with vendors selling everything from fabrics, cheap clothes and electronics. As well as the steady flow of pedestrian traffic, pushcarts, worn-out vespers and the occasional truck overflowing with fresh produce all add to the madness.', 'Sampeng Lane Market', '', 1, NULL, NULL, '/sampeng-1.jpg'),
